tes":{"text":"Pessoas Contaminadas = 0.0968%"},"id":"49561","type":"Paragraph"},{"attributes":{"text":"Taxa de Crescimento = 5.5581"},"id":"49562","type":"Paragraph"},{"attributes":{"text":"Fator de Crescimetno = 127.5000"},"id":"49563","type":"Paragraph"},{"attributes":{"text":"As predi\u00e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"49564","type":"Paragraph"},{"attributes":{"text":"&lt;select onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"NERNRSCA24004.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24004&lt;/option&gt;&lt;option value=\"NERNRSCA24008.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24008&lt;/option&gt;&lt;option value=\"NERNRSCA24003.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24003&lt;/option&gt;&lt;option value=\"NERNRSCA24006.html\"&gt;Regiao de Sa\u00fade: NERNRSCA24006&lt;/option&gt;&lt;option value=\"NERNRSCA24002.html\"&gt;Regiao de Sa\u00fade: NERNRSC
